+----------------+
|Game Description|
+----------------+

Sink your teeth into this action-packed educational adventure. Hungry sharks and piranhas are on the hunt as you SCUBA dive around them. Type words fast to zap the predators... before they turn you into lunch!

Originally released June 11th, 2003.

+----------------------------------+
|Instructions / System Requirements|
+----------------------------------+

No install or crack is required for this portable version. Extract the ZIP file and create a shortcut to the executable (EXE) to play.

This game is compatible with Windows 98, ME, 2000, XP, Vista(32/64bit) and 7(32/64bit). Requires DirectX 7.0 or later. Processor requirements: 350MHz CPU or higher. RAM requirements: 128 MB or higher. Requires a DirectX-compatible Sound and Video card with at least 16 MB of video memory.

